import Vue from 'vue';
import Router from 'vue-router';
import Login from '@/views/UserLogin.vue';

Vue.use(Router);

const router = new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/login',
      name: 'Login',
      component: Login
    },
    // Adicione aqui outras rotas conforme necessário
  ]
});

export default router;
